        super(props);
        this.state = null;
    }

    componentWillMount(){
    }

	render(){
		return(
			<div className='container'>
				<Aside />
				<Main />
                <Chart
                    chartType='ScatterChart'
                    data={[['Age', 'Weight'], [4,5,5], [8.12]]}
                    width='100%'
                    height='400px'
                    legendToggle
                    />
			</div>
		)
	}
}

export default App
